import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import "./css/feedback.css";
var FontAwesome = require('react-fontawesome');

function Feedback() {
    return (
        <div>
            <div class="container-fluid">
                <div class="row">
                <div className="col-12">
                    Feedback
                </div>
                </div>
            </div>
        </div>
    );
}

export default Feedback;
